const BASE_URL =
"https://learn.codeit.kr/api/film-reviews/"
    "https://learn.codeit.kr/api/film-reviews/"
export async function getDeliveryLists(order = 'deliveryDate') {
    const query = `order=${order}`;

    const response = await fetch(
        `${BASE_URL}?${query}`
    );
    const body = await response.json();
    return body;
}
